import React from 'react';
import { Link } from 'react-router-dom';
import '../components/css/Body';  // Assuming CSS styling is present

const Body = () => {
  return (
    <div className="body-container">
      <div className="menu">
        <Link to="/shops" className="menu-item">Shops</Link>
        <Link to="/deals" className="menu-item">Deals</Link>
        <Link to="/events" className="menu-item">Events</Link>
        <Link to="/contact" className="menu-item">Contact Us</Link>
      </div>
      {/* Rest of the body content */}
    </div>
  );
};

export default Body;
